import { useEffect, useState } from 'react';
import './App.css';

function App() {

  const [city, setCity] = useState(city)

  useEffect(()=>{
    fetch('https://api.weatherbit.io/v2.0/current?lat=35.7721&lon=-78.63861&key=097dd5fffd324ebb875e47ef3fed2fa1	')
      .then(data => data.json())
      .then(data => console.log(data))
      .then(data => setCity(data.city_name))
  },[])

  return (
    <div className="App">
      <h1>{city}</h1>
    </div>
  );
}

export default App;
